import React from 'react'

const FormValidate = ({input}) => {
      console.log('values=',input);
      const errors = {}

      var emailpattern = /^[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,4}$/;


      if(input.name === ''){
        errors.name = 'Name is Requierd'
      }

      if(input.email === ''){
        errors.email = 'Email is Requierd'
      }
        else if (emailpattern.test(input.email)){
        errors.email = 'Email did not Match'
      }

      if(input.payment === ''){
        errors.payment ='please select payment methode !!!'
      }
        else if(<input type="text" />.payment !== 'cod'){
        errors.payment ='Sorry currently Only available Cash on Delivery !!!'
      } 
      console.log('error=',errors);
  return errors
}

export default FormValidate
